import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with elements
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone 15 Pro Max');

    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productTitle = await page.textContent('.product-card .product-title');

    return {
      success: true,
      action: "Searched for a product and captured search results",
      extractedData: { productTitle },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
